import React from 'react';
import { Container } from 'react-bootstrap';
function Tabs()
{
    return(
        <div className="tab-main">
            <Container>
            <div className="delivery">
                <a href="delivery"></a>
            </div>
            </Container>
        </div>
    );
}
export default Tabs;
